def binary_search(data, target):
    """"""
    low = 0
    high = len(data) - 1
    while low <= high:
        index = (low + high) // 2
        value = data[index]
        if value == target:
            return index
        if target < value:
            high = index - 1
        else:
            low = index + 1
    return -1
